import React from 'react';
import Menubar from '../components/Menubar';
import {
   Jumbotron, Container, Card, CardHeader, CardFooter, CardBody,
   CardTitle, CardText
} from 'reactstrap';
import 'styles.css'

function Home({ data }) {
   return (
      <>
         <Menubar />
         <Jumbotron fluid className="list">
            <Container className="meta-container">
               <h1>Minhas metas</h1>
               {data.metas.map(meta => (
                  <Card key={meta._id}>
                     <CardHeader tag="h4">{meta.name}</CardHeader>
                     <CardBody>
                        <CardText>{meta.description}</CardText>
                        <CardFooter>{meta.status}</CardFooter>
                     </CardBody>
                  </Card>
               ))}
            </Container>
         </Jumbotron>
      </>
   )
}

export async function getServerSideProps() {
   const response = await fetch(`http://localhost:8080/metas`)
   const data = await response.json()

   return { props: { data } }
}

export default Home
